import React from 'react';
import axios from 'axios';
import WeatherPreview from './components/weather.js';

class Members extends React.Component {
  constructor(props) {
    super(props);
    this.state = { 
        name: 'Members!'
    };
  }

  render() {
    return (
        <React.Fragment>
        <WeatherPreview />
        <h1>{this.state.name}</h1>
        </React.Fragment>
    );
  }
}

export default Members;
